CREATE TABLE student (
    SRN CHAR(13) NOT NULL,
    Student_name VARCHAR(50) NOT NULL,
    Dept_id INT NOT NULL,
    Section VARCHAR(10) NOT NULL,
    CGPA DECIMAL(4,2) NOT NULL,
    email_id VARCHAR(50) NOT NULL,
    CONSTRAINT PK_student PRIMARY KEY (SRN)
);

CREATE TABLE course (
    Course_id VARCHAR(10) NOT NULL,
    Elective_ID ENUM("1","2") NOT NULL,
    Course_name VARCHAR(50)unique NOT NULL,
    Credits INT NOT NULL DEFAULT 4,
    AnchorTeacher varchar(15) unique NOT NULL,
    Dept_id INT NOT NULL,
    CONSTRAINT PK_course PRIMARY KEY (Course_id)
);

CREATE TABLE faculty (
    Faculty_id varchar(15) NOT NULL,
    Faculty_name VARCHAR(50) NOT NULL,
    Dept_id INT NOT NULL,
    Course_id VARCHAR(10) NOT NULL,
    experience INT NOT NULL DEFAULT 0,
    CONSTRAINT PK_faculty PRIMARY KEY (Faculty_id)
);

CREATE TABLE classroom (
    Class_id INT NOT NULL,
    Room_name VARCHAR(50) unique NOT NULL,
    Capacity INT NOT NULL,
    Class_no INT NOT NULL,
    Building_name VARCHAR(50) NOT NULL,
    Floor_no INT NOT NULL,
    Class_type ENUM("sem","room") NOT NULL,
    CONSTRAINT PK_classroom PRIMARY KEY (Class_id)
);

CREATE TABLE department (
    Dept_id INT NOT NULL,
    Dept_name VARCHAR(50) NOT NULL,
    HOD_id VARCHAR(15) NOT NULL,
    no_of_students INT NOT NULL,
    no_of_faculty INT NOT NULL,
    CONSTRAINT PK_department PRIMARY KEY (Dept_id)
);

CREATE TABLE chooses (
    SRN CHAR(13) NOT NULL,
    Course_id VARCHAR(10) NOT NULL,
    F1 varchar(15) NOT NULL,
    F2 varchar(15),
    F3 varchar(15),
    F4 varchar(15),
    CONSTRAINT PK_chooses PRIMARY KEY (SRN,Course_id)
    
);

CREATE TABLE allotted_for (
    Elective_ID ENUM("1","2") NOT NULL,
    Course_id VARCHAR(10) NOT NULL,
    Class_id INT NOT NULL,
    Faculty_id varchar(15) NOT NULL,
    SRN CHAR(13) NOT NULL,
    CONSTRAINT PK_allotted_for PRIMARY KEY (Course_id,Class_id,SRN)
   
);













 





















