DELIMITER $$

CREATE PROCEDURE GetElectiveDeets(IN elective_name VARCHAR(255))
BEGIN
declare course varchar(255);
select elective_name into course;
select s.srn,s.cgpa,c.course_id, c.f1,c.f2,c.f3,c.f4 from student s, chooses c,course ch where s.srn=c.srn and c.course_id=ch.course_id and ch.course_name=course order by s.cgpa desc;
END$$

DELIMITER ;

DELIMITER $$

CREATE PROCEDURE GetElectiveTeach(IN elective_name VARCHAR(255))
BEGIN
declare course varchar(255);
select elective_name into course;
select f.faculty_id from faculty f, course c where f.course_id=c.course_id and c.course_name=course;
END$$

DELIMITER ;

