DELIMITER $$

CREATE PROCEDURE GetElectiveID(IN coursename VARCHAR(20))
BEGIN
declare courseid varchar(20);
    select coursename into courseid;
    SELECT elective_id 
    FROM course
    WHERE course_name = courseid;
END$$

