DELIMITER $$
CREATE FUNCTION GetStudentDetails(course_id varchar(20))
RETURNS INT
DETERMINISTIC
BEGIN
    DECLARE val INT;
    SELECT count(*) into val
    FROM classroom cl, allotted_for a 
    WHERE a.class_id=cl.class_id AND a.srn=srn AND a.course_id=course_id;
    RETURN val;
END$$

