--Nested Queries

--faculty
SELECT
    f.Faculty_id,
    f.Faculty_name,
    CASE
        WHEN a.count_srn > 60 THEN 'seminar hall'
        ELSE 'classroom'
    END AS Teaching_Location
FROM
    faculty f
JOIN (
    SELECT
        faculty_id,
        COUNT(srn) AS count_srn
    FROM
        allotted_for
    GROUP BY
        faculty_id
) a ON f.Faculty_id = a.faculty_id;


--course
SELECT af.course_id, c.course_name, COUNT(*) AS student_count
FROM allotted_for af,course c
WHERE af.course_id=c.course_id
GROUP BY af.course_id
HAVING COUNT(*) > (
    SELECT AVG(student_count)
    FROM (SELECT course_id, COUNT(*) AS student_count FROM allotted_for GROUP BY course_id) AS avg_counts
);



--trigger

DELIMITER $$

CREATE TRIGGER PreventMultipleAllocations
BEFORE INSERT ON faculty
FOR EACH ROW
BEGIN
    DECLARE teacher_count INT;
    
    -- Check if the faculty_id is already allocated to a subject
    SELECT COUNT(*) INTO teacher_count
    FROM faculty
    WHERE faculty_id = NEW.faculty_id;

    -- If the teacher is already allocated to a subject, raise an error
    IF teacher_count > 0 THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Teacher is already allocated to a subject';
    END IF;
END$$

DELIMITER ;





