DELIMITER $$

--student
CREATE PROCEDURE GetStudentDetails(IN srn VARCHAR(255))
BEGIN
DECLARE id varchar(255);
SELECT srn into id;
SELECT a.srn,a.elective_id,c.course_name,f.faculty_name,cl.room_name, cl.Building_name, cl.floor_no, cl.class_type 
FROM allotted_for a, course c,faculty f,classroom cl 
WHERE a.course_id=c.course_id AND f.faculty_id=a.faculty_id AND a.class_id=cl.class_id AND a.srn=id;
END$$

DELIMITER ;

--faculty
DELIMITER $$

CREATE PROCEDURE GetTeacherDetails(IN fid VARCHAR(255))
BEGIN
DECLARE id varchar(255);
SELECT fid into id;
SELECT a.srn,s.student_name, a.elective_id,c.course_name,f.faculty_name,cl.room_name, cl.Building_name, cl.floor_no, cl.class_type 
FROM allotted_for a, course c,faculty f,classroom cl, student s 
WHERE a.course_id=c.course_id AND a.srn=s.srn AND f.faculty_id=a.faculty_id AND a.class_id=cl.class_id AND a.faculty_id=id;
END$$

